import Card from "../UI/Card";
import './User.css'
const User = (props) => {
  return (<div>
        <Card className="user">
            <div className="user-des">
                <p>{props.name}</p>
                <div className="user-age">( {props.age} years old)</div>
            </div>
        </Card>
  </div>)

};
export default User;
